import React from 'react';
import { ContentHeader, i18n } from 'config/C4';

const PersonalView = () => {
  const { personalview: { title} } = i18n();
  return (
    <div className="personalView">
      <ContentHeader title={title} />
    </div>
  )
}

export default PersonalView;
